import React, { FunctionComponent } from "react";
import User from "../../../models/user";
import Event from "../../../models/event";
import "./style.css"

type Props = {
    users: Array<User>
    events: Array<Event>
};

const AdminTable: FunctionComponent<Props> = ({ users, events }) => {
    return (
        <div className="mt50">
            <h2 className="blue">list users</h2>
            <ul>
                {users.map(user => (
                    <li className="flex-row flex-center flex-bet">
                        <p>{user.name}</p>
                        <p>{user.email}</p>
                        <p>{user.role}</p>
                        <i className="material-icons">edit</i>
                    </li>
                ))}
            </ul>
            <h2 className="blue">Event users</h2>
            <ul>
                {events.map(user => (
                    <li className="flex-row flex-center flex-bet">
                        <p>{user.name}</p>
                        <p>{user.date}</p>
                        <p>{user.locality}</p>
                        <p>{user.maxPlace}</p>
                        <p>{user.dispoPlace}</p>
                        <i className="material-icons">edit</i>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default AdminTable
